var BytecodeWNSRegistry = "";
var BytecodeAuctionRegistrar = "";
var BytecodeReverseRegistrar = "";
var BytecodePublicResolver = "";
var BytecodeReverseResolver = "";

var deployer = eth.accounts[0];
var admin = eth.accounts[1];
var wanManager = eth.accounts[2];
var testManager = eth.accounts[3];
var wns;
var auctionRegistrar;
var reverseRegistrar;
var publicResolver;
var reverseResolver;


// 1.deploy registry
var deployWNS = function(){
    var wnsContract = web3.eth.contract(ABIWNSRegistry);
    wns = wnsContract.new({
        from: web3.eth.accounts[0],
        data: BytecodeWNSRegistry,
        gas: 4700000,
        gasPrice: 200000000000 
    }, function (e, contract){
        console.log(e, contract);
        if (typeof contract.address !== 'undefined') {
             console.log('WNS Registry Contract mined! address: ' + contract.address + ' transactionHash: ' + contract.transactionHash);
        }
    });
};

// deploy  registrars and resolvers
var deployRegistrar = function (){
// deploy auction registrar
    var auctionRegistrarContract = web3.eth.contract(ABIAuctionRegistrar);
    auctionRegistrar = auctionRegistrarContract.new(
        wns.address,
        namehash('wan'),
        0,
        {from: web3.eth.accounts[0],
        data: BytecodeAuctionRegistrar,
        gas: 4700000,
        gasPrice: 200000000000 
    }, function (e, contract){
        console.log(e, contract);
        if (typeof contract.address !== 'undefined') {
             console.log('AuctionRegistrar Contract mined! address: ' + contract.address + ' transactionHash: ' + contract.transactionHash);
        }
    });

// deploy public resolver
    var PublicResolverContract = web3.eth.contract(ABIPublicResolver);
    publicResolver = PublicResolverContract.new(
        wns.address,
        {from: web3.eth.accounts[0],
        data: BytecodePublicResolver,
        gas: 4700000,
        gasPrice: 200000000000 
    }, function (e, contract){
        console.log(e, contract);
        if (typeof contract.address !== 'undefined') {
             console.log('PublicResolver Contract mined! address: ' + contract.address + ' transactionHash: ' + contract.transactionHash);
        }
    });

//deploy reverse resolver
    var ReverseResolverContract = web3.eth.contract(ABIReverseResolver);
    reverseResolver = ReverseResolverContract.new(
        wns.address,
        {from: web3.eth.accounts[0],
        data: BytecodeReverseResolver,
        gas: 4700000,
        gasPrice: 200000000000 
    }, function (e, contract){
        console.log(e, contract);
        if (typeof contract.address !== 'undefined') {
             console.log('ReverseResolver Contract mined! address: ' + contract.address + ' transactionHash: ' + contract.transactionHash);
        }
    });

};

var deployReverseRegistrar = function(){
    var reverseRegistrarContract = web3.eth.contract(ABIReverseRegistrar);
    reverseRegistrar = reverseRegistrarContract.new(
        wns.address,
        reverseResolver.address,
        {from: web3.eth.accounts[0],
        data: BytecodeReverseRegistrar,
        gas: 4700000,
        gasPrice: 200000000000 
    }, function (e, contract){
        console.log(e, contract);
        if (typeof contract.address !== 'undefined') {
             console.log('reverseRegistrar Contract mined! address: ' + contract.address + ' transactionHash: ' + contract.transactionHash);
        }
    });    
};

var delegateTLD = function(){
// transfer first level node to newly created registrar
    wns.setSubnodeOwner('0x0',web3.sha3('wan'), auctionRegistrar.address, {from:eth.accounts[0], gasPrice: 200000000000, gas:1000000});

    wns.setSubnodeOwner('0x0', web3.sha3('reverse'), eth.accounts[0], {from: eth.accounts[0], gasPrice: 200000000000, gas:1000000});
    wns.setSubnodeOwner(namehash('reverse'), web3.sha3('addr'), reverseRegistrar.address, {from: eth.accounts[0], gasPrice: 200000000000, gas:1000000});

    //transfer root node owner to foundation reserved address
    var foundationAddr = '0x6B5f125f6E9945c37d5996098fDd54FFE90C6Ba6';
    wns.setOwner('0x0', foundationAddr , {from:eth.accounts[0], gasPrice: 200000000000, gas:1000000}); 
};


